import './Gallery.css';

const images = [
  "",
  "https://source.unsplash.com/400x300/?students,classroom",
  "https://source.unsplash.com/400x300/?library",
  "https://source.unsplash.com/400x300/?campus",
  "https://source.unsplash.com/400x300/?seminar",
  "https://source.unsplash.com/400x300/?lab"
];

function Gallery() {
  return (
    <div className="gallery">
      <h1>Campus Gallery</h1>
      <div className="gallery-grid">
        {images.map((src, index) => (
          <img key={index} src={src} alt={`Gallery ${index + 1}`} />
        ))}
      </div>
    </div>
  );
}

export default Gallery;
